import React from "react";
import { Link } from "react-router-dom";
const Nav=()=>{
    return(
        <div >
            <ul></ul>
            <Link to="/">Home</Link>
            <Link to="/profile">Profile</Link>
            <Link to="/add">Add Product</Link>
            <Link to="/remove">Remove Product</Link>
            <Link to="/contact">Contact</Link>
        </div>
    )
}

export default Nav
